import logo from '../../logo.svg'

import { Link, Route, Switch } from 'react-router-dom'



import './App.css'
import NavBar from "../NavBar/NavBar"

const App = () => {
  return (
    <div>
      <MenuBar />

      <Switch>
        <Route exact path="/"><Home/></Route>
        <Route path="/admin"><Admin/></Route>
      </Switch>
    </div>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function Admin() {
  return <h2>Admin</h2>;
}

function Nesto() {
  return <h2>Users</h2>;
}

export default App
